import { header } from '../../portfolio'
import Navbar from '../Navbar/Navbar'
import Resume from '../Resume/Resume'
import './Header.css'

const Header = () => {
  const { homepage, title } = header

  return (
    <header className='header center'>
      <h3>
        {homepage ? (
          <a className='link'>
            {title}
          </a>
        ) : (
          title
        )}
      </h3>
      <Navbar />
      <Resume />
    </header>
  )
}

export default Header
